(2875, 74, 'In a particular year there were 15 deaths from automobiles per 1000 miles travelled. A total of 30,000 miles were travelled via automobiles in that year. In the same year 700 people died in airplane crashes and 500 people were killed in train disasters. A statistician concludes that it was more dangerous to travel by plane, train and automobile, in that order. Which of the following statements refutes the statistician’s conclusion?', 'There is no common denominator by which to compare the number of deaths resulting from each mode of travel', 'One year is insufficient to reach such a conclusion', 'More people travel by car than by any other mode, therefore, the possibility of a car accident is greater', 'The probability of getting killed in a train disaster is the greatest', 'N/A', NULL, NULL, NULL, NULL, NULL, NULL, 'C', '2024-03-25 20:56:53', '2024-03-25 20:56:53'),
