(2983, 76, 'A polling agency recently surveyed 1,000 adults who were selected at random from a large city and asked each of the adults, “Are you satisfied with the quality\nof air in the city?” Of those surveyed, 78 percent responded that they were satisfied with the quality of air in the city. Based on the results of the survey,\nwhich of the following statements must be true?\n\nI. Of all adults in the city, 78 percent are satisfied with the quality of air in the city.\nII. If another 1,000 adults selected at random from the city were surveyed, 78 percent of them would report they are satisfied with the quality of air in the city.\nIII. If 1,000 adults selected at random from a different city were surveyed, 78 percent of them would report they are satisfied with the quality of air in the city.', 'None', 'II only', 'I and II only', 'I and III only', 'N/A', NULL, NULL, NULL, NULL, NULL, NULL, 'B', '2024-03-25 22:02:14', '2024-03-25 22:02:14'),
